import React, { useState, useEffect } from "react";

import { PetsSkeleton } from "./shared/PetsSkeleton";
import { PetsError } from "./shared/PetsError";
import { PetsList } from "./shared/PetsList";

import { fetchPets } from "../service/petsApi";

export const NormalFetchData = () => {
  const [{ data, error, isLoading }, dispatch] = useState({
    data: null,
    error: null,
    isLoading: true
  });

  useEffect(() => {
    fetchPets()
      .then(data => dispatch({ data, error: null, isLoading: false }))
      .catch(error => dispatch({ data: null, error, isLoading: false }));
  }, []);

  if (isLoading) return <PetsSkeleton />;
  if (error) return <PetsError error={error} />;
  return <PetsList pets={data} />;
};
